import React from 'react';
import data from './sample_db_10km.json'


function MyComponent() {
 
  

  return (
    <div>
      {data.map(item => (
        <div key={item.id}>
          <h2>{item.title}</h2>
          <p>{item.content}</p>
        </div>
      ))}
    </div>
  );
}
export default MyComponent;
